import React, { Component } from "react";
import When from "./When";
import Where from "./Where";

class Wedding extends Component {
	render() {
		return (
			<div id="wedding" className="section-content" data-aos="zoom-in">
				<h1>Wedding Bells</h1>
				<p>
					Join us when the groom and bride tie the knot with all the rituals. In
					this event groom arrives to the bride's home with all his relatives
					and family typically known as "Baraat". The groom's family will dance
					again at the door of the bride's house. The brides family will welcome
					and greet the groom and his family. It a party time and without you
					the celebrations will be incomplete. Do join us in the Wedding and
					give your blessing to newly weds.
				</p>
				<div className="row">
					<div className="col">
						<When
							day={"Monday"}
							date={"28th"}
							month={"November"}
							year={"2022"}
							startTime={"10:00 AM"}
							endTime={"6:00 PM"}
						/>
					</div>
					<div className="col">
						<Where
							addressLine1={"VIP Road, Near Gopuri Square,"}
							addressLine2={"Nalwadi, Wardha (India) - 442001"}
							location={"https://goo.gl/maps/ckfSjo9kHbLd3qug9"}
						/>
					</div>
				</div>
			</div>
		);
	}
}

export default Wedding;
